import Footerr from "../Footer";
import NavBar from "../Navbar";
import { useState, useEffect } from "react";
import Axios  from 'axios';
import Table from 'react-bootstrap/Table'
import { Link, useParams } from "react-router-dom";
import { loadStripe } from "@stripe/stripe-js";
//import ProductImage from '../images/flask.png'
import CheckoutForm from "./CheckoutForm";
import PayamentForm from "./PayamentForm";
//import './BookTest.css';
import {
  CardElement,
  useStripe,
  useElements, 
  Elements
} from "@stripe/react-stripe-js";


const BookTest = () => {
    const { id } = useParams();
    const [testList, setTestList] = useState([]);
    const [changeTest, setChangeTest] = useState();
    const [stripeError, setStripeError] = useState(null);
    const [isLoading, setLoading] = useState(false);


    useEffect(() => {
      Axios.get("http://localhost:5000/appmntt")
      .then((response) => {
          setTestList(response.data)
          console.log(response.data)
      })
      
    }, [])
   
    const stripeTestPromise = loadStripe('pk_test_51KStWED1JpqiLwVaytqSErusAHZGu163TahSPZ4zc7jkb3rH0r9Z67Id2tvQ2LlENsXcnRdaZ3cJxgf0L9OqT50e00tSv5hQym')


    return ( 
    <div>
        <NavBar/>

        
        <div className="text-center fs-1">Book Test Appoinmnet</div>
        <div className="container d-flex justify-content-center align-items-center ">
        {    
            testList.filter(tests => tests.test_id == id )
            .map((test) => (
                <div>                     
                  <tr key={test.test_id}>
                    <td className="text-center">{test.test_id} </td>
                    <td>{test.testName} </td>
                    <td className="text-center"><button value={test.test_id} className="btn btn-primary btn-sm px-3 text-light">
                    </button></td>
                  </tr>
                  </div>)
              )
        } 
        
        </div>


        <div className="container">
          <Elements stripe={stripeTestPromise}>
            <PayamentForm />
          </Elements>
        </div>




        <Footerr/>
    </div> );
}
 
export default BookTest;
